CREATE FUNCTION public.query_common_garden_borders() RETURNS TABLE(geojson_string text)
    LANGUAGE plpgsql
    AS $$
declare

begin
	return query
	select '{"type": "FeatureCollection", "features": [{"type": "Feature", "geometry": {"type": "Point", "coordinates": [' ||
poly_center_long || ', ' || poly_center_lat || ']},"properties": {"title": "' || UPPER(name) || '", "marker-color": "#FD1134"}}]}'
as geojson_point
from (
	select ST_X(ST_Centroid(border)) as poly_center_long,
	ST_Y(ST_Centroid(border)) as poly_center_lat, name
	from lookup_common_garden_borders
) pc
union
select '{"type" : "GeometryCollection", "geometries" : [{"type" : "Polygon", "coordinates" : [['
|| poly_string || ']], "properties" : {"height" : 0}}]}'
from (
	select string_agg(poly_point, ',') poly_string from
	(
		select  '[' || ST_X(geom) || ',' || ST_Y(geom) || ']' as poly_point, name from (
			select (ST_DumpPoints(border)).*, name
			from lookup_common_garden_borders
		) pd
		order by name, path
	) pp
	group by name
) ps
;
end;
$$;


