--

CREATE FUNCTION public.query_route_create_base(_lookup_route_id integer, _route_table_name text) RETURNS integer
    LANGUAGE plpgsql
    AS $$
--declare
begin
	
	-- clear out old route data if exists
	EXECUTE format(e'delete from %I where lookup_route_id = %s', _route_table_name, _lookup_route_id);
	
	--cost = distance
	EXECUTE format(e'insert into %I (id, site_id_1, site_id_2, geom, cost, source, target, lookup_route_id)
	SELECT DISTINCT on
    (LEAST((X.id::text) || (Y.id::text), (Y.id::text) || (X.id::text))) 
    dense_rank()
        OVER(ORDER BY LEAST((X.id::text) || (Y.id::text), (Y.id::text) || (X.id::text)))::bigint AS id,
    X.id AS site_id_1, 
    Y.id AS site_id_2,
    ST_MakeLine(X.geo_point, Y.geo_point)::GEOMETRY(LineString,4326) AS geom,
    ST_Distance(X.geo_point::GEOGRAPHY, Y.geo_point::GEOGRAPHY)/1000 AS cost,
    X.id AS source, 
    Y.id AS target,
	%s as lookup_route_id
	FROM  
	    (select * from bsd_site where id in (select min(id) from bsd_site where id in (select id from temp_selected_bsd_site_ids) group by geo_point)) X 
	CROSS join
		(select * from bsd_site where id in (select min(id) from bsd_site where id in (select id from temp_selected_bsd_site_ids) group by geo_point)) Y
	WHERE  
	    X.id <> Y.id', _route_table_name, _lookup_route_id);
	   
	return 1;
end;
$$;


