--

CREATE FUNCTION public.query_route_create_user_base_route(_route_name text, _user_id integer) RETURNS integer
    LANGUAGE plpgsql
    AS $$
declare
	return_holder int;
	lookup_route_id int;
begin 
	select query_route_insert_into_lookup_routes(_route_name, _user_id) into return_holder;

	select lr.id into lookup_route_id
	from lookup_routes lr 
	where lr.user_id = _user_id
	and lr.name = upper(_route_name);

	select query_route_create_base(lookup_route_id, 'routes') into return_holder;

	return 1;
end;
$$;


