-- Name: query_route_ts_all_points_android(integer, text, text, text); Type: FUNCTION; Schema: public; Owner: cesium
--

CREATE FUNCTION public.query_route_ts_all_points_android(_lookup_route_id integer, _name_of_routes_table text, _starting_point text, _export_table_name text) RETURNS integer
    LANGUAGE plpgsql
    AS $$
declare
	c refcursor;
	c_record record;
	point_order int;
	starting_point int;
	ending_point int;
	sitename text;
begin
	
	EXECUTE format(e'delete from %I', _export_table_name);

	--get first starting point
	starting_point := _starting_point::int;

	--get sitename
--	select initcap(name) into sitename from bsd_site bs
--	join lookup_common_garden_borders lcgb on lookup_sitename_id  = lcgb.id
--	where bs.id = starting_point;
	
	--get costs for all points
	EXECUTE format(e'INSERT INTO temp_floyd_warshall SELECT * FROM pgr_floydWarshall(\'SELECT id, source, target, cost FROM %I where lookup_route_id = %s\', false) order by start_vid, agg_cost', _name_of_routes_table, _lookup_route_id);

	point_order := 1;


	
	select end_vid into ending_point from temp_floyd_warshall
	where start_vid = starting_point
	and agg_cost = (
		select min(agg_cost) from temp_floyd_warshall
		where start_vid = starting_point
	);

	EXECUTE format(e'insert into %I (point_order, latitude, longitude, organism_name)
	select %s, ST_Y(geo_point),  ST_X(geo_point), organism_name from bsd_site bs join bsd_tree bt on bt.site_id = bs.id where bs.id = %s',
	_export_table_name, point_order, starting_point);
	
/* get the rest of the points */
loop
--exit when (select id from temp_floyd_warshall where start_vid not in (select * from temp_visited_points)) is null
	open c for select start_vid from temp_floyd_warshall where end_vid not in (select * from temp_visited_points);
	fetch c into c_record;
	exit when not found;
	starting_point := ending_point;
	point_order := point_order + 1;
	--find shortest point
	select end_vid into ending_point from temp_floyd_warshall
	where start_vid = starting_point
	and agg_cost = (
		select min(agg_cost) from (select * from temp_floyd_warshall where end_vid not in (select * from temp_visited_points)) vp
		where start_vid = starting_point
	);
	
	EXECUTE format(e'insert into %I (point_order, latitude, longitude, organism_name)
	select %s, ST_Y(geo_point),  ST_X(geo_point), organism_name from bsd_site bs join bsd_tree bt on bt.site_id = bs.id where bs.id = %s',
	_export_table_name, point_order, starting_point);

close c;
end loop;
/* END LOOP */
	return 1;
end;
$$;


ALTER FUNCTION public.query_route_ts_all_points_android(_lookup_route_id integer, _name_of_routes_table text, _starting_point text, _export_table_name text) OWNER TO cesium;

