-- Name: query_site_genotype(text, text); Type: FUNCTION; Schema: public; Owner: cesium
--

CREATE FUNCTION public.query_site_genotype(_geno_type text, _marker_color text) RETURNS TABLE(geojson_string text)
    LANGUAGE plpgsql
    AS $$
declare

begin
	return query
	select '{"type": "FeatureCollection", "features": [{"type": "Feature", "geometry": {"type": "Point", "coordinates": [' ||
ST_X(geo_point) || ', ' || ST_Y(geo_point) || ']},"properties": {"title": "' || genotype || '", "bsd_sample_id": "' || id ||
'", "marker-color": "' || _marker_color || '"}}]}'
as geojson_point from (
	select id, 
		upper("InitialGenotype" || '_' ||  "SiteGridX" || '_' || "SiteGridY") as genotype,
		geo_point
	from bsd_site f
	cross join lateral json_to_record(f.info) as 
		x("InitialGenotype" text, "SiteGridX" text, "SiteGridY" text)
) bs
where genotype is not null
and genotype like '%' || _geno_type || '%'
;
end;
$$;


