-- Name: query_site_sitename_id(text, text); Type: FUNCTION; Schema: public; Owner: cesium
--

CREATE FUNCTION public.query_site_sitename_id(_sitename_id text, _marker_color text) RETURNS TABLE(geojson_string text)
    LANGUAGE plpgsql
    AS $$
declare

begin
	return query
--	select '{"type": "FeatureCollection", "features": [{"type": "Feature", "geometry": {"type": "Point", "coordinates": [' ||
--	ST_X(geo_point) || ', ' || ST_Y(geo_point) || ']},"properties": {"marker-color": "' || _marker_color || '", "psql_id" : "'
--	|| id::text || '", ' || substring(info::text, 2) || '}]}' as geojson_string from bsd_site bs
--	where lookup_sitename_id = _sitename_id::int
	select '{"type": "FeatureCollection", "features": [{"type": "Feature", "geometry": {"type": "Point", "coordinates": [' ||
	ST_X(geo_point) || ', ' || ST_Y(geo_point) || ']},"properties": {"marker-color": "' || _marker_color || '", "bsd_site_id" : "'
	|| id::text || '", "Planting Date": "' || 
		case
			when tr.planting_date is null then
				'N/A'
			else
				tr.planting_date::text 
		end 
	||'", ' ||  substring(info::text, 2) || '}]}' as geojson_string from bsd_site bs
	left outer join (select bt.site_id, planting_date from bsd_tree bt 
			join (select id from bsd_site where lookup_sitename_id = _sitename_id::int) bs2
			on bs2.id = bt.site_id) tr
	on bs.id = tr.site_id
	where lookup_sitename_id = _sitename_id::int
	;
end;
$$;


